class Counter extends Component {
    constructor(props) {
        super(props);
    
        this.state = {
          text: 0,
        };
      }
    
      clickHandler = () => {
        this.setState((prevState) => {
          return { text: prevState.text + 1 }
        })
      }
    render() {
    return (
      <div>
        {}
      </div>
    )
  }
}

export default Counter
